    describe("functionOutputsAreNumeric", function () {
        var functions = [new FunctionOutput(2, {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(true);
        functions = [new FunctionOutput("2", {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(true);
        functions = [new FunctionOutput("sad", {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(false);
        functions = [new FunctionOutput("", {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(false);
        functions = [new FunctionOutput(null, {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(false);
        functions = [new FunctionOutput(true, {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(true);
        functions = [new FunctionOutput("sad", {"1": 1}), new FunctionOutput("3", {"1": 1})];
        expect(Analysis.functionOutputsAreNumeric(functions)).toEqual(false);
    });

    describe("convertToNumericOutput", function () {
        var functions = [new FunctionOutput("2", {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).toEqual([new FunctionOutput(2, {"1": 1})]);
        functions = [new FunctionOutput(2, {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).toEqual([new FunctionOutput(2, {"1": 1})]);
        functions = [new FunctionOutput("sad", {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).not.toEqual([new FunctionOutput(NaN, {"1": 1})]);
        functions = [new FunctionOutput("", {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).toEqual([new FunctionOutput(0, {"1": 1})]);
        functions = [new FunctionOutput(null, {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).toEqual([new FunctionOutput(0, {"1": 1})]);
        functions = [new FunctionOutput(true, {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).toEqual([new FunctionOutput(1, {"1": 1})]);
        functions = [new FunctionOutput("sad", {"1": 1}), new FunctionOutput("3", {"1": 1})];
        expect(Analysis.convertToNumericOutput(functions)).not.toEqual([new FunctionOutput(NaN, {"1": 1}), new FunctionOutput(3, {"1": 1})]);
    });

    describe("dictAdd", function () {
        var d1, d2, d3;
        d1 = new HashMap();
        d2 = new HashMap();
        d1.put(new AST.Address(1, 2, "sheet", "book"), 2);
        d2.put(new AST.Address(5, 6, "sheet1", "book1"), 3);
        d3 = Analysis.dictAdd(d1, d2);
        expect(d3.getEntrySet().length).toEqual(2);
        expect(d3.get(new AST.Address(1, 2, "sheet", "book"))).toEqual(2);
        expect(d3.get(new AST.Address(5, 6, "sheet1", "book1"))).toEqual(3);
        expect(d3.get(new AST.Address(25, 6, "sheet1", "book1"))).toBeUndefined();
    });

    describe("BootstrapFrequency", function () {
        var boots = [new FunctionOutput("aa", {}), new FunctionOutput("cd", {}), new FunctionOutput("ab", {}), new FunctionOutput("aa", {})];
        var res = Analysis.BootstrapFrequency(boots);
        expect(res["aa"]).toEqual(0.5);
        expect(res["cd"]).toEqual(0.25);
        expect(res["ab"]).toEqual(0.25);
        expect(res["asda"]).toBeUndefined();
    });

    describe("RejectNullHypothesis String", function () {
        var boots = [new FunctionOutput("aa", {"1": 1}), new FunctionOutput("cd", {"2": 2}), new FunctionOutput("ab", {"1": 1}), new FunctionOutput("aa", {"1": 1})];
        expect(Analysis.rejectNullHypothesis(boots, "aa", 1)).toEqual(false);
        expect(Analysis.rejectNullHypothesis(boots, "23", 1)).toEqual(true);
        expect(Analysis.rejectNullHypothesis(boots, "aa", 5)).toEqual(true);


    });

